   link: 'https://www.meetup.com/German-Conversation-Club-Munich/events/269062468/',
   description: '<p>Wir laufen ab Bahnhof Pasing zum Schlo√ü Blutenburg (ein ehemaliges Jagdschloss) und besichtigen dort den James-Kr√ºss-Turm, die Binette-Schr√∂der- Illustrationen im Kabinett und die Zeichnungen, Fotos und Buchausgaben von Michael Ende.</p> <p>Michael Ende ist mit Erich K√§stner der ber√ºhmteste Kinderbuchautor Deutschlands. ‚ÄûMomo‚Äú eines seiner ber√ºhmtesten B√ºcher existiert in √ºber 50 Sprachen!</p> <p>Das im sp√§t gotischen Stil erbaute Schloss Blutenburg wird gerne auch wegen der sehenswerten Schlosskapelle besucht. Nach dem Kulturgenuss fahren wir zur \'Pasinger Fabrik\' um etwas leckeres zu essen und zu trinken.<br/>Der Eintritt ins Schloss betr√§gt Euro 3.- und Organisationsgeb√ºhr f√ºr die Sprachschule Edeltraud Euro 3.-<br/>Ich freue mich auf diesen Ausflug der somit Kultur und Genuss verbindet.</p> <p>We walk from Pasing station to Schloss Blutenburg (a former hunting lodge) and visit the James-Kr√ºss Tower, the Binette Schr√∂der illustrations in the cabinet and the drawings, photos and book editions by Michael Ende.</p> <p>Michael Ende is with Erich K√§stner the most famous children\'s book author in Germany. \'Momo\' one of his most famous books exists in over 50 languages!</p> <p>The castle Blutenburg which was built in late Gothic style, is also popular because of the castle chapel which is well worth seeing. After the cultural enjoyment we drive to the \'Pasinger Fabrik\' to eat and drink something delicious.<br/>The entrance fee to the castle is Euro 3 and the organization fee for the language school Edeltraud is Euro 3.<br/>I am looking forward to this excursion which combines culture and pleasure.</p> ',
