   link: 'https://www.meetup.com/Le-Wagon-Munich/events/268679736/',
   description: '<p>‚≠êÔ∏èPLEASE REGISTER VIA EVENTBRITE : <a href=\'https://lew.ag/mucssmarch\' class=\'linkified\'>https://lew.ag/mucssmarch</a> ‚≠êÔ∏è</p> <p>DISCLAIMER: you should have some basic HTML/CSS knowledge to come.</p> <p>This is a FREE workshop on CSS Components Design!</p> <p>If you already have some knowledge of HTML, CSS and have briefly played with Bootstrap (<a href=\'http://getbootstrap.com/\' class=\'linkified\'>http://getbootstrap.com/</a>), then this workshop will be great fun.</p> <p>If you\'ve been to one of our \'Build your landing page in 2 hours\' / \'Introduction to HTML &amp; CSS\' workshops, this will be the perfect follow-up.</p> <p>üëáIn this workshop you will be learning to code üëá</p> <p>- Navbars</p> <p>- Buttons</p> <p>- Cards</p> <p>- Dropdown-lists</p> <p>- Banners &amp; badges</p> <p>- Other UI components that you can find on most apps</p> <p>To do that, we will cover lots of cool CSS techniques and patterns by reproducing components from existing websites (Product Hunt or Medium). Positioning techniques, flexbox, transitions, filters, etc.. you\'ll learn a lot of crazy CSS stuff, we promise!</p> <p>üëáHow to prepare and what to bringüëá</p> <p>1) Your own laptop - FULLY CHARGED</p> <p>2) Make sure you have Google Chrome installed and running on your computer: <a href=\'https://www.google.com/chrome/\' class=\'linkified\'>https://www.google.com/chrome/</a></p> <p>3) Download SublimeText Editor: <a href=\'http://www.sublimetext.com/3\' class=\'linkified\'>http://www.sublimetext.com/3</a> (<a href=\'http://www.sublimetext.com/2\' class=\'linkified\'>http://www.sublimetext.com/2</a>)</p> <p>‚≠êÔ∏èPLEASE REGISTER VIA EVENTBRITE : <a href=\'https://lew.ag/mucssmarch\' class=\'linkified\'>https://lew.ag/mucssmarch</a> ‚≠êÔ∏è</p> <p>***************************************</p> <p>Plug and Play is the ultimate innovation platform, co-working community and event space established in late 2017 in Munich, with 3 different industry focus areas: Insurtech, Health and Retailtech. Together with our partners in Germany and around the globe, we are building a startup, corporate and venture capital ecosystem in the heart of Bavaria!</p> <p>üëâWebsite: <a href=\'https://www.plugandplaytechcenter.com/munich/\' class=\'linkified\'>https://www.plugandplaytechcenter.com/munich/</a></p> <p>üëâLinkedIn : <a href=\'https://www.linkedin.com/company/plug-and-play-munich\' class=\'linkified\'>https://www.linkedin.com/company/plug-and-play-munich</a></p> <p>üëâFacebook : <a href=\'https://www.facebook.com/pnpMunich/\' class=\'linkified\'>https://www.facebook.com/pnpMunich/</a></p> <p>üëâ Contact : [masked]</p> <p>***************************************<br/>Le Wagon is Europe\'s leading coding school for entrepreneurs and creative people. We are now present in 35 cities worldwide, with over 120 startups in operation, and have been rated the no#1 coding bootcamp worldwide on Course Report &amp; Switchup! Our full-stack web development course equips aspiring entrepreneurs, product managers, designers, and junior developers with the technical skills they need to build great products and startups!</p> <p>The next batch in Munich starts on March 30th 2020. Further details about the course and how to apply can be found here (<a href=\'https://www.lewagon.com/munich\' class=\'linkified\'>https://www.lewagon.com/munich</a>).</p> <p>üëâJoin our Meetup group: <a href=\'https://www.meetup.com/de-DE/Le-Wagon-Munich/\' class=\'linkified\'>https://www.meetup.com/de-DE/Le-Wagon-Munich/</a></p> <p>üëâLike us on Facebook: <a href=\'http://facebook.com/lewagongermany\' class=\'linkified\'>http://facebook.com/lewagongermany</a></p> <p>üëâFollow us on Twitter: <a href=\'https://twitter.com/lewagonmunich\' class=\'linkified\'>https://twitter.com/lewagonmunich</a></p> <p>üëâLook at some lovely photos on Instagram: <a href=\'https://www.instagram.com/lewagonmunich/\' class=\'linkified\'>https://www.instagram.com/lewagonmunich/</a></p> <p>***************************************</p> <p>We look forward to meeting you soon!</p> <p>Team Le Wagon</p> ',
